import React, { useEffect, useState } from "react";
import axios from "axios";
import "./SupportDashboard.css";
import { useNavigate } from "react-router-dom";

const AdminDashboard = () => {
  const [tickets, setTickets] = useState([]);
  const [selectedCategory, setSelectedCategory] = useState("");
  const [selectedPriority, setSelectedPriority] = useState("");
  const navigate = useNavigate();

  const categories = [
    "Yazƒ±lƒ±m Hatasƒ±",
    "Donanƒ±m Sorunu",
    "Kullanƒ±cƒ± Eri≈üimi",
    "Aƒü Problemleri",
  ];

  const priorities = ["D√º≈ü√ºk", "Orta", "Y√ºksek", "Acil"];

  useEffect(() => {
    fetchTickets();
  }, []);

  useEffect(() => {
    fetchTickets();
  }, [selectedCategory, selectedPriority]);

  const fetchTickets = async () => {
    try {
      const token = localStorage.getItem("token");

      const params = {};
      if (selectedCategory) params.category = selectedCategory;
      if (selectedPriority) params.priority = selectedPriority;

      const res = await axios.get("http://localhost:5094/api/ticket/filter", {
        headers: { Authorization: `Bearer ${token}` },
        params: params,
      });

      setTickets(res.data);
    } catch (err) {
      console.error("Ticketlar alƒ±namadƒ±:", err);
      alert("Ticketlar y√ºklenirken bir hata olu≈ütu.");
    }
  };

  const handleDelete = async (ticketId) => {
    const confirmed = window.confirm("Bu ticket'ƒ± silmek istediƒüinizden emin misiniz?");
    if (!confirmed) return;

    try {
      const token = localStorage.getItem("token");

      await axios.delete(`http://localhost:5094/api/ticket/deleteTicket/${ticketId}`, {
        headers: { Authorization: `Bearer ${token}` },
      });

      alert("Ticket ba≈üarƒ±yla silindi.");
      fetchTickets();
    } catch (err) {
      console.error("Silme hatasƒ±:", err);
      alert("Ticket silinirken bir hata olu≈ütu.");
    }
  };

  return (
    <div className="support-container">
      <div className="sidebar">
        <div className="logo">HelpDesk</div>
        <ul className="nav">
          <li onClick={() => navigate("/ticket-list")} style={{ cursor: "pointer" }}>
            <span className="icon">üé´</span> <span className="label">Tickets</span>
          </li>
        </ul>
        <div className="profile">
          <img src="https://i.pravatar.cc/40" alt="admin" />
          <span>Admin</span>
        </div>
      </div>

      <div className="main-content">
        <div className="form-box">
          <h2 className="text-2xl font-bold mb-4">Filtreler</h2>
          <div className="ticket-detail-container">
            <div className="message-area">
              <label>Kategori</label>
              <select value={selectedCategory} onChange={(e) => setSelectedCategory(e.target.value)}>
                <option value="">Hepsi</option>
                {categories.map((cat, index) => (
                  <option key={index} value={cat}>
                    {cat}
                  </option>
                ))}
              </select>
            </div>

            <div className="message-area">
              <label>√ñncelik</label>
              <select value={selectedPriority} onChange={(e) => setSelectedPriority(e.target.value)}>
                <option value="">Hepsi</option>
                {priorities.map((p, index) => (
                  <option key={index} value={p}>
                    {p}
                  </option>
                ))}
              </select>
            </div>
          </div>
        </div>

        <div className="form-box">
          <h2 className="text-2xl font-bold mb-2">Ticket Listesi</h2>
          <ul className="ticket-list">
            {tickets.map((ticket) => (
              <li key={ticket.id}>
                <div onClick={() => navigate(`/ticket/${ticket.id}`)} style={{ cursor: "pointer" }}>
                  <strong>{ticket.description}</strong>
                  <br />
                  Kategori: {ticket.category} - √ñncelik: {ticket.priority}
                </div>

                <div className="ticket-actions">
                  <button onClick={() => navigate(`/edit-ticket/${ticket.id}`)} className="edit-button">
                    ‚úèÔ∏è D√ºzenle
                  </button>
                  <button onClick={() => handleDelete(ticket.id)} className="delete-button">
                    üóëÔ∏è Sil
                  </button>
                </div>
              </li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
